import EachChatMessage from "./EachChatMessage";

type ChatChannelMessagesProps = {
  activeChannelId: number;
  allChatMessages: {
    messageId: number;
    userId: number;
    userName: string;
    userAvatar: string;
    messageTimeStamp: string;
    messageContent: string;
    channelId: number;
    channelName: string;
  }[];
};

function ChatChannelMessages(props: ChatChannelMessagesProps) {
  console.log("ChatChannelMessages");

  const activeChannelId = props.activeChannelId;

  props.allChatMessages.map((message) => {
    if (activeChannelId === message.channelId) {
      return (
        <EachChatMessage
          key={message.messageId}
          useId={message.userId}
          userName={message.userName}
          userAvatar={message.userAvatar}
          messageTimeStamp={message.messageTimeStamp}
          messageContent={message.messageContent}
          channelName={message.channelName}
        />
      );
    }
  });
}

export default ChatChannelMessages;
